import React from "react";
import { connect } from "react-redux";
// import { bindActionCreators } from 'redux';
// import { goBack } from '../../redux-modules/modules/Home';
import PageTitle from "../../components/title/Index";
import { MdKeyboardBackspace } from "react-icons/md";

const ProfilePage = props => {
  const { history } = props;
  let content = [];
  const getSoldList = JSON.parse(localStorage.getItem("sold"));
  const handleClickProduct = (e, id) => {
    e.preventDefault();
    history.push(`/detail/${id}`);
  };
  if (getSoldList) {
    if (getSoldList.length > 0) {
      getSoldList.map((data, index) => {
        content.push(
          <div key={index} className="profile__content-sold">
            <div
              className="row profile__sold-product"
              onClick={e => handleClickProduct(e, data.id)}
            >
              <div className="col-sm-4 text-left">
                <img src={data.imageUrl} alt="products" />
              </div>
              <span className="col-sm-8 padding-left-4 text-left">
                <div>{data.title}</div>
                <div className="padding-top-2">{data.price}</div>
              </span>
            </div>
          </div>
        );
        return data;
      });
    }
  }
  const backToHome = e => {
    e.preventDefault();
    history.goBack();
  };
  console.log("data home", getSoldList);
  return (
    <PageTitle title="Purchase">
      <div className="wrapper">
        <div className="profile">
          <div className="d-flex margin-top-4">
            <MdKeyboardBackspace
              className="fa-heart text-left"
              onClick={e => {
                backToHome(e);
              }}
            />
            <span className="padding-left-4">Purchase History</span>
          </div>
          <div className="margin-top-2 profile__search-sold">{content}</div>
        </div>
      </div>
    </PageTitle>
  );
};
const mapStateToProps = (state, props) => ({
  dataHome: state.home
});

// const mapDispatchToProps = dispatch => bindActionCreators({
//     goBack,
// }, dispatch);
export default connect(mapStateToProps, null)(ProfilePage);
